import React from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';


class Model extends React.Component{

    render(){
        return(
            <div>
                <h1>{this.props.name}
                </h1>
            </div>
        )
    }
}
export default Model;
